import { ROUTES } from '../../Routes';

const menus = [
    {
        id: 1,
        name: 'Home',
        links: ROUTES.ROOT_LINK
    },
    {
        id: 2,
        name: 'Explore',
        links: ROUTES.EXPLORE_PATH
    }
]

export default menus;
